```
class camera {
  // constructor
  constructor(
    private position: vec3,
    private target: vec3,
    private up: vec3,
    private fov: number,
    private aspectratio: number,
    private znear: number,
    private zfar: number,
    private movement: vec3,
    private rotation: vec3
  ) {}

  // getters
  get position(): vec3 {
    return this.position;
  }

  get target(): vec3 {
    return this.target;
  }

  get up(): vec3 {
    return this.up;
  }

  get fov(): number {
    return this.fov;
  }

  get aspectratio(): number {
    return this.aspectratio;
  }

  get znear(): number {
    return this.znear;
  }

  get zfar(): number {
    return this.zfar;
  }

  get movement(): vec3 {
    return this.movement;
  }

  get rotation(): vec3 {
    return this.rotation;
  }

  // setters
  set position(value: vec3) {
    this.position = value;
  }

  set target(value: vec3) {
    this.target = value;
  }

  set up(value: vec3) {
    this.up = value;
  }

  set fov(value: number) {
    this.fov = value;
  }

  set aspectratio(value: number) {
    this.aspectratio = value;
  }

  set znear(value: number) {
    this.znear = value;
  }

  set zfar(value: number) {
    this.zfar = value;
  }

  set movement(value: vec3) {
    this.movement = value;
  }

  set rotation(value: vec3) {
    this.rotation = value;
  }

  // update camera position
  update(delta: number) {
    // calculate movement vector
    const move = vec3.create();
    vec3.scale(move, this.movement, delta);

    // calculate rotation vector
    const rot = vec3.create();
    vec3.scale(rot, this.rotation, delta);

    // update camera position
    vec3.add(this.position, this.position, move);
    vec3.add(this.target, this.target, rot);
  }

  // get camera matrix
  getmatrix() {
    // calculate perspective matrix
    const perspective = mat4.create();
    mat4.perspective(perspective, this.fov, this.aspectratio, this.znear, this.zfar);

    // calculate view matrix
    const view = mat4.create();
    mat4.lookat(view, this.position, this.target, this.up);

    // multiply matrices
    const matrix = mat4.create();
    mat4.multiply(matrix, view, perspective);

    // return matrix
    return matrix;
  }
}
```

this api provides a camera object with the following properties and methods:

- `position`: the current position of the camera in 3d space.
- `target`: the position the camera is looking at.
- `up`: the up vector of the camera.
- `fov`: the field of view of the camera in degrees.
- `aspectratio`: the aspect ratio of the camera.
- `znear`: the near clipping plane of the camera.
- `zfar`: the far clipping plane of the camera.
- `movement`: the movement vector of the camera.
- `rotation`: the rotation vector of the camera.

the `update` method is used to update the camera position based on user input. The `getmatrix` method is used to calculate the camera matrix for rendering.

