class transaction {
  final string coin;
  final datetime date;
  final double profitloss;
  const transaction({required this.coin, required this.date, required this.profitloss});
}

class coinstats {
  num profitlossaverage = 0;
  num numtransactions = 0;
  list<transaction> transactions = [];
  coinstats({required this.transactions, required this.profitlossaverage, required this.numtransactions});
}

list<coinstats> calculatecoinstats(list<transaction> transactions) {
  map<string, coinstats> coins = {};
  for (transaction t in transactions) {
    if (coins.containskey(t.coin)) {
      coinstats cs = coins[t.coin]!;
      cs.numtransactions++;
      cs.profitlossaverage += t.profitloss;
    } else {
      coins[t.coin] = coinstats(transactions: [t], profitlossaverage: t.profitloss, numtransactions: 1);
    }
  }
  list<coinstats> sortedcoins = coins.values.tolist();
  sortedcoins.sort((a, b) => b.numtransactions.compareto(a.numtransactions));
  return sortedcoins;
}

list<transaction> topcoins(list<coinstats> coins, int numcoins) {
  return coins.take(numcoins).expand((cs) => cs.transactions).tolist();
}

void main() {
  list<transaction> transactions = [
    transaction(coin: "bitcoin", date: datetime(2021, 1, 1), profitloss: 10.0),
    transaction(coin: "ethereum", date: datetime(2021, 1, 2), profitloss: 5.0),
    transaction(coin: "bitcoin", date: datetime(2021, 1, 3), profitloss: 20.0),
    transaction(coin: "ethereum", date: datetime(2021, 1, 4), profitloss: 25.0),
    transaction(coin: "bitcoin", date: datetime(2021, 1, 5), profitloss: 15.0),
    transaction(coin: "ethereum", date: datetime(2021, 1, 6), profitloss: 10.0),
    transaction(coin: "bitcoin", date: datetime(2021, 1, 7), profitloss: 12.0),
    transaction(coin: "ethereum", date: datetime(2021, 1, 8), profitloss: 18.0),
  ];
  list<coinstats> coins = calculatecoinstats(transactions);
  list<transaction> topprofitcoins = topcoins(coins, 3);
  list<transaction> toplosscoins = topcoins(coins.reversed().tolist(), 3);
  print("top profit coins:");
  for (transaction t in topprofitcoins) {
    print(t.coin + " " + t.date.tostring() + " " + t.profitloss.tostring());
  }
  print("top loss coins:");
  for (transaction t in toplosscoins) {
    print(t.coin + " " + t.date.tostring() + " " + t.profitloss.tostring());
  }
}
```

