import java.io.File;
import java.io.FileInputStream;
import java.io.IOException;
import java.util.ArrayList;
import java.util.List;

import org.apache.poi.ss.usermodel.Cell;
import org.apache.poi.ss.usermodel.Row;
import org.apache.poi.ss.usermodel.Sheet;
import org.apache.poi.ss.usermodel.Workbook;
import org.apache.poi.ss.usermodel.WorkbookFactory;

public class MagneticFieldDataReader {
    public static void main(String[] args) throws IOException {
        // Specify the path to the Excel spreadsheet
        String spreadsheetPath = "path/to/spreadsheet.xlsx";

        // Create a list to store the `MagneticFieldData` objects
        List<MagneticFieldData> magneticFieldData = new ArrayList<>();

        // Read the data from the spreadsheet
        File file = new File(spreadsheetPath);
        FileInputStream inputStream = new FileInputStream(file);
        Workbook workbook = WorkbookFactory.create(inputStream);
        Sheet sheet = workbook.getSheetAt(0);
        Row row;
        Cell cell;
        for (int I = 1; I < sheet.getLastRowNum() + 1; i++) {
            row = sheet.getRow(i);
            cell = row.getCell(0);
            String location = cell.toString();
            cell = row.getCell(1);
            double latitude = cell.getNumericCellValue();
            cell = row.getCell(2);
            double longitude = cell.getNumericCellValue();
            cell = row.getCell(3);
            double magneticFieldIntensity = cell.getNumericCellValue();
            magneticFieldData.add(new MagneticFieldData(location, latitude, longitude, magneticFieldIntensity));
        }

        // Print the data
        for (MagneticFieldData data : magneticFieldData) {
            System.out.println(data.getLocation() + " " + data.getLatitude() + " " + data.getLongitude() + " " + data.getMagneticFieldIntensity());
        }

        // Write the data to a new Excel spreadsheet
        Workbook newWorkbook = WorkbookFactory.create(WorkbookFactory.XSSF);
        Sheet newSheet = newWorkbook.createSheet("Magnetic Field Data");
        Row newRow = newSheet.createRow(0);
        Cell newCell;
        newCell = newRow.createCell(0);
        newCell.setCellValue("Location");
        newCell = newRow.createCell(1);
        newCell.setCellValue("Latitude");
        newCell = newRow.createCell(2);
        newCell.setCellValue("Longitude");
        newCell = newRow.createCell(3);
        newCell.setCellValue("Magnetic Field Intensity");
        for (int I = 0; I < magneticFieldData.size(); i++) {
            newRow = newSheet.createRow(i + 1);
            newCell = newRow.createCell(0);
            newCell.setCellValue(magneticFieldData.get(i).getLocation());
            newCell = newRow.createCell(1);
            newCell.setCellValue(magneticFieldData.get(i).getLatitude());
            newCell = newRow.createCell(2);
            newCell.setCellValue(magneticFieldData.get(i).getLongitude());
            newCell = newRow.createCell(3);
            newCell.setCellValue(magneticFieldData.get(i).getMagneticFieldIntensity());
        }
        newWorkbook.write(new File("path/to/new/spreadsheet.xlsx"));
    }
}
```

